(1, '[\"cpanel@q-mktops.com\"]', '[\"escortdemo@q-mktops.com\"]', '[]', '[]', '1704964864', '[q-mktops.com] Client configuration settings for escortdemo@q-mktops.com.', '<body style=\"background:#F4F4F4\">\r\n    <div style=\"margin:0;padding:0;background:#F4F4F4\">\r\n        <table cellpadding=\"10\" cellspacing=\"0\" border=\"0\" width=\"100%\" style=\"width:0 auto;\">\r\n            <tbody>\r\n                <tr>\r\n                    <td align=\"center\">\r\n                        <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"680\" style=\"border:0;width:0 auto;max-width:680px;\">\r\n                            <tbody>\r\n                                <tr>\r\n                                                                        <td width=\"680\" height=\"25\" style=\"font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;font-size:16px;color:#333333\">\r\n                                                                                                                                Client Configuration settings for escortdemo@q-mktops.com.                                                                            </td>\r\n                                                                    </tr>\r\n                                <tr>\r\n                                                                        <td style=\"padding: 15px 0 20px 0; background-color: #FFFFFF; border: 2px solid #E8E8E8; border-bottom: 2px solid #FF6C2C;\">\r\n                                        <table width=\"680\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background:#FFFFFF;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;\">\r\n                                            <tbody>\r\n                                                <tr>\r\n                                                    <td width=\"15\">\r\n                                                    </td>\r\n                                                    <td width=