         <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaPassword\">Password:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaPassword\" class=\"escape-note\"> Use the email accounts password.</td>\r\n                  </tr>\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaIncomingServer\">Incoming Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaIncomingServer\" class=\"data\">mail.q-mktops.com\r\n                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Internet Message Access Protocol\" class=\"initialism\">IMAP</abbr> Port: 993</li>\r\n                              \r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Post Office Protocol 3\" class=\"initialism\">POP3</abbr> Port: 995</li>\r\n                              \r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                  \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaOutgoingServer\">Outgoing Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaOutGoingServer\" class=\"data\">mail.q-mktops.com\r\n                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Simple Mail Transfer Protocol\">SMTP</abbr> Port: 465</li>\r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                  \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" colspan=\"2\" class=\"notes\">\r\n                                                    \r\n                                                                                <div id=\"lblSettingsAreaSmallNote1\" class=\"small_note\">IMAP, POP3, and SMTP require authentication.</div>\r\n                      </td>\r\n                  </tr>\r\n              </table>\r\n          </div>\r\n         </div>\r\n  \r\n      </div>\r\n        \r\n\r\n        <div class=\"row\" id=\"nonSSL\" style=\"display: none\">\r\n         <div class=\"col-md-6\">\r\n           <div id=\"non_ssl_settings_area\"\r\n            \r\n            style=\"background-color: #fff;  border: 1px solid transparent; border-radius: 4px; box-shadow: 0 1px 1px rgba(0, 0, 0, 0.05); margin-bottom: 20px; border-color: #f6c342;\"\r\n            \r\n           class=\"panel panel-default panel-warning\">\r\n               <div\r\n                \r\n                style=\"border-top-left-radius: 3px; border-top-right-radius: 3px; padding: 10px 15px; background-color: #fcf8e1; border-color: #f6c342; color: #333;\"\r\n                \r\n                class=\"panel-heading\">\r\n                <span id=\"descNonSSLSettings\" class=\"caption not-recommended\">Non-SSL Settings (NOT Recommended)</span>\r\n              </div>\r\n              <table id=\"tblManualSettingsTable\" class=\"table manual_settings_table\" style=\"border-collapse: collapse; border-spacing: 0; margin-bottom: 0; width: 100%; background-color: transparent; max-width: 100%;\">\r\n                  <tr>\r\n  